SELECT ?property ?hasValue ?isValueOf WHERE { { 
<http://dbpedia.org/resource/A_Journey_to_the_Center_of_the_Earth> ?property ?hasValue 
} UNION{ 
?isValueOf ?property <http://dbpedia.org/resource/A_Journey_to_the_Center_of_the_Earth> }
}

